import React from 'react';

import Banner 			from '../blocks/Banner.js';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';


export default class HomeCarousel extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div>
				<OwlCarousel className="owl-theme arrows owl-carousel" loop  autoplay={true} animateOut={false} animateIn={false} autoplaySpeed={500} items={1} nav dots={false}>
				   <div className="item active">
				      <img src="/images/banner1.png" alt="Los Angeles"/>
				    </div>

				    <div className="item">
				      <img src="/images/banner2.png" alt="Chicago"/>
				    </div>

				    <div className="item">
				      <img src="/images/banner3.png" alt="New York"/>
				    </div>
				</OwlCarousel>
			</div>
		);
	}
}
